import React from 'react';
import { Card,CardTitle,CardSubtitle,CardText, CardImg, CardBody, Button, Spinner,Row,Col } from "reactstrap";
const Sino = (props) => {
    return (
        <>
            <div>
                <Button color="success">SINO</Button>
            </div>
            <div>
                <Spinner color="info" >
                    Loading...
                </Spinner>
            </div>
            <div>
                <Row>
                    <Col></Col>
                    <Col>
                <Card
                    style={{
                        width: '18rem'
                    }}
                >
                    <CardImg
                        alt="Sample"
                        src="https://picsum.photos/300/200"
                    />
                    <CardBody>

                        <Button>
                            YES
                        </Button>&nbsp;
                        <Button>
                            NP
                        </Button>
                    </CardBody>
                </Card>
                </Col>
                <Col></Col>
                </Row>

            </div>
        </>
    );
}
/*function Sino(props){
